import React from "react";
import "./About.css";
export default function About() {
  return (
    <div className="about">
      <h2 className="text-white">MARWAN ABDELWAHAB</h2>
      <h3>I AM WEB </h3>
      <h3>designer & developer</h3>
      <p>Specialized in front end web development</p>
      <h4>
        Have an experience in web designing and development building high
        quality & responsive websites using HTML, CSS, Bootstrap ,Tailwind CSS,
        JavaScript and React JS.
      </h4>
    </div>
  );
}
